import React from "react";
import { Nav, NavLink, NavMenu } 
    from "./NavbarElements";
  
const Navbar = () => {
  return (
    <>
      <Nav>
        <NavMenu>
          <NavLink to="/dashboard" activeStyle>
            Dashboard
          </NavLink>
          <NavLink to="/submissions" activeStyle>
            Submissions
          </NavLink>
        </NavMenu>
      </Nav>
    </>
  );
};
  
export default Navbar;
